graphql.query:
mutation ($payload:ToolsCreateWebhookLoggerInput!)
{
	toolsCreateWebhookLogger (payload:$payload)
	{
		id
		rowId
		url
		headerRequest
		bodyRequest
	}
}

query ($query:QueryStatement $constraint:QueryStatement)
{
	toolsPaginateWebhookLoggers (query:$query constraint:$constraint)
	{
		total
		count
		rows
	}
}

query ($query:QueryStatement)
{
	toolsGetWebhookLoggers (query: $query)
	{
		id
		rowId
		url
		headerRequest
		bodyRequest
		createdAt
		updatedAt
	}
}

query ($query:QueryStatement)
{
	toolsFindWebhookLogger (query: $query)
	{
		id
		rowId
		url
		headerRequest
		bodyRequest
		createdAt
		updatedAt
	}
}

query ($id:ID)
{
	toolsFindWebhookLoggerById (id:$id)
	{
		id
		rowId
		url
		headerRequest
		bodyRequest
		createdAt
		updatedAt
	}
}

mutation ($payload:ToolsUpdateWebhookLoggerInput!)
{
	toolsUpdateWebhookLogger (payload:$payload)
	{
		id
		rowId
		url
		headerRequest
		bodyRequest
		createdAt
		updatedAt
	}
}

mutation ($id:ID!)
{
	toolsDeleteWebhookLoggerById (id:$id)
	{
		id
		rowId
		url
		headerRequest
		bodyRequest
		createdAt
		updatedAt
	}
}

mutation ($query:QueryStatement)
{
	toolsDeleteWebhookLoggers (query: $query)
	{
		id
		rowId
		url
		headerRequest
		bodyRequest
		createdAt
		updatedAt
	}
}
